import React from "react";
import PropTypes from 'prop-types';
import styled from 'styled-components';

import Styles from './characterFilm.style';

const Image = styled.div`${Styles.container}`;

const characterFilm = ({
  id, title, description, producer, releaseDate
}) => {
  return (
    <>
      <div>
        <Image index={id} />
        <div>{title}</div>
        <div>Date Created: {releaseDate}</div>
        <div>Director: {producer}</div>
        <div>{description}</div>
      </div>
    </>
  );
};

characterFilm.defaultProps = {

}

export default characterFilm;
